import { BrowserRouter, Route, Routes } from "react-router-dom";
import { useState, useEffect } from "react";
import Memory from "./pages/Memory";
import News from "./pages/News";
import Diary from "./pages/Diary";
import data from "./data.json";
import diarydata from "./diarydata.json";
import NewsSearch from "./pages/NewsSearch";
import Community from "./pages/Community";
import CC from "./pages/CommunityContent";
import CS from "./pages/CommunitySearach";
import CW from "./pages/CommunityWrite";
import communitydata from "./communitydata.json";

function App() {
  const today = new Date();
  const hour = useState(today.getHours());
  const min = useState(today.getMinutes());

  const [dataList, setDataList] = useState([]);

  const [diarydataList, setDiaryDatList] = useState([]);

  const [communitydataList, setCommunityDataList] = useState([]);

  useEffect(() => {
    setDataList(data);
    setDiaryDatList(diarydata);
  }, []);

  return (
    <BrowserRouter>
      <Routes>
        <Route
          path="/memory/:memoryId"
          element={<Memory hour={hour} min={min} dataList={dataList} />}
        />
        <Route
          path="/diary/:diaryId"
          element={
            <Diary hour={hour} min={min} diarydataList={diarydataList} />
          }
        />
        <Route path="/news" element={<News hour={hour} min={min} />} />
        <Route path="/search" element={<NewsSearch hour={hour} min={min} />} />
        <Route
          path="/community"
          element={
            <Community
              hour={hour}
              min={min}
              communitydataList={communitydataList}
            />
          }
        />
        <Route
          path="/cs"
          element={
            <CS hour={hour} min={min} communitydataList={communitydataList} />
          }
        />
        <Route
          path="/cw"
          element={
            <CW hour={hour} min={min} communitydataList={communitydataList} />
          }
        />
        <Route
          path="/cc"
          element={
            <CC hour={hour} min={min} communitydataList={communitydataList} />
          }
        />
      </Routes>
    </BrowserRouter>
  );
}

export default App;
